    render() {
        let styles = {
            verticalAlign: "middle",
            // Use CSS instead of the width prop to support non-pixel units (eg: rem)
            width: this.props.size,
            height: this.props.size,
            marginLeft: this.props.marginLeft,
            marginRight: this.props.marginRight
        };
        // This specific background class adds the color as a fill using the classname.
        // ALl colours in the Colors folder are automatically available here.
        // Also note, hover states can be added by using the following syntax:
        // const color = Background.redSVGHober;
        const colour = this.props.colour || Background.redSVG;

        if (this.props.onClick) {
            return (
                <div data={this.props.data} onClick={this.props.onClick} className={[this.props.hoverColor, Font.pointer].join(" ")}>
                    {this._renderGraphic(styles, [this.props.color, Background.childHoverTargetSVG].join(" "), this.props.data)}
                </div>
            );
        }
        return this._renderGraphic(styles, colour);
    }
